__NUXT_JSONP__("/drugs/CENP-E_Inhibitor_GSK-923295A", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1088965-37-0",chebiId:b,chemicalFormula:b,definition:"A small-molecule inhibitor of the mitotic kinesin centromere-associated protein E (CENP-E), with potential antineoplastic activity. Upon administration, GSK-923295A binds to and inhibits CENP-E, thereby preventing cell division, inducing cell cycle arrest, and ultimately leading to an inhibition of cell proliferation. CENP-E, a kinetochore-associated mitotic kinesin, plays an essential role in chromosome movement during mitosis and regulates cell-cycle transition from metaphase to anaphase.",fdaUniiCode:"072702W9QD",identifier:"C91080",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C273"],synonyms:[c,"Centromere-Associated Protein E Inhibitor GSK-923295","GSK 923295","GSK 923295A","GSK-923295","GSK-923295A","GSK923295","GSK923295A"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FCENP-E_Inhibitor_GSK-923295A",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("CENP-E_Inhibitor_GSK-923295A","","CENP-E Inhibitor GSK-923295A","2021-10-30T13:47:18.883Z")));